pragma solidity >=0.4.22 <0.7.0;

import "../ERC721/ERC721Metadata.sol";

contract Tyosasyo is ERC721Metadata{

    struct Survey {
        uint256 tokenNumber;
        address mintedby;
        address owner;
        string detail;
        bool borrowed;
    }

    mapping (uint => Survey) private surveys;
    mapping (bytes32 => uint) private mynumber;
    mapping (address => uint) private tokendetail;
    mapping (address => uint) private addressMint;

    uint private tokenCounter;

    address private center;

    constructor() public ERC721Metadata("Survey Token System", "STS"){
        tokenCounter = 0;
        center = msg.sender;
    }

        function addToken(string memory uri) public {
        tokenCounter++;
        super._mint(msg.sender,msg.sender, tokenCounter);
        super._setTokenURI(tokenCounter,uri);
    }

    //発行者がトークンを送信するための関数
    function transfer(address to, uint index) public {
        require(surveys[index].borrowed == false && msg.sender == surveys[index].mintedby,"あなたはそのトークンの所有者ではありません");
        super._transferFrom(surveys[index].mintedby, to, index);
        surveys[index].borrowed = true;
        surveys[index].owner = to;
    }

    //トークンを発行者に返す関数
    function returnT(uint _index) public {
        require(
            surveys[_index].borrowed == true && msg.sender != surveys[_index].mintedby && msg.sender == surveys[_index].owner,"あなたはそのトークンの所有者ではありません"
        );
        super._transferFrom(msg.sender, surveys[_index].mintedby, _index);
        surveys[_index].borrowed = false;
        surveys[_index].owner = surveys[_index].mintedby;
    }
    //自己回収
    function MyreturnT(uint _index) public {
        //uint index = tokendetail[msg.sender] + _index - 1;
        super._transferFrom(surveys[_index].owner,msg.sender, _index);
        surveys[_index].borrowed = false;
        surveys[_index].owner = surveys[_index].mintedby;
    }


    function EditTokenA(string _detail, address from) public {
        uint index = tokendetail[from];
        surveys[index].detail = _detail;
    }

 function Inquiry(uint index, address sd) external view returns (
        uint tokenNumber,
        address mintedby,
        address owner,
        string detail,
        bool borrowed
        ) {
        uint i;
        if(index % 3 == 1){
            i = tokendetail[sd];
        }else if(index % 3 == 2){
            i = tokendetail[sd]+1;
        }else{
            i = tokendetail[sd]+2;
        }
        Survey memory token = surveys[i];
        require(msg.sender == token.owner, "トークン発行者はその調査書情報は参照できません");
        tokenNumber = token.tokenNumber;
        mintedby = token.mintedby;
        owner = token.owner;
        detail = token.detail;
        borrowed = token.borrowed;
    }


}

